import {FaTimes} from 'react-icons/fa'


const Cv = ({tasks,editTask}) => {


  return (
    <>
    <div key={tasks.count} className='first'>
        <div className='name' >
            {tasks.text}
            </div>
            <div className='name'>
            {tasks.tel}
            </div>
            <div className='name'>
            {tasks.email}
            <FaTimes onClick={() =>editTask(tasks.count)}style={{color:'red'}} /> 

            </div>
    </div>


    </>
  );
};

export default Cv;
